$("#createsubmit").click=function(){const n=$("form").attr("action");$.ajax({url:n,method:"POST",body:new FormData($("form")[0]),enctype:"multipart/form-data",processData:!1,contentType:!1,cache:!1,success:function(n){n.includes("Error")?(sweetAlert({title:"Error",text:n,type:"error"}),window.location.reload()):sweetAlert({title:"Done",text:"Baner Created Successfuly",type:"success",showConfirmButton:!0,showCancelButton:!0,confirmButtonText:"Return To Index",cancelButtonText:"Add One More"}).then(async function(n){if(n.dismiss!="cancel")window.location.replace("/Admin/Baner");else window.location.reload()})}})};